UPDATE zip_files_processing
SET status = 'KO'
WHERE ff_uuid = '${source.uuid}';

update log_summary
SET total_records = ${text.line.count:minus(1)}
where ff_uuid= '${files_uuid}'

UPDATE files_ingestion
SET
	status = '${status:isNull()
						:ifElse(
							${wn_ingestion.status:notNull()
							:ifElse(
								'KO',
								${wait.counter.OK:notNull():and(${wait.counter.OK:gt(0)}):ifElse('OK','KO')}
							)},
							${status}
						)
				}',
	storage_date = ${wn_ingestion.timestamp:isNull():ifElse("null", ${wn_ingestion.timestamp:format("yyyy-MM-dd HH:mm:ss.SSS"):prepend("TIMESTAMP '"):append("'")})},
	storage_name = ${wn_ingestion.filename:isNull():ifElse("null", ${wn_ingestion.filename:prepend("'"):append("'")})}
WHERE ff_uuid = '${files_uuid}';

${filename:startsWith('diksha_data_summary'):ifElse("delete from  diksha_content_temp where ff_uuid ='${zip_identifier}';",
${filename:startsWith('diksha_tpd'):and(${filename:startsWith('diksha_tpd_mapping'):not()}):ifElse("delete from  diksha_tpd_content_temp where ff_uuid ='${zip_identifier}';",
${filename:startsWith('diksha_tpd_mapping'):ifElse('delete from diksha_tpd_mapping_temp where ff_uuid="${zip_identifier}"','None')})}
)}

null validation
file: ${filename} null values are found.
Total null values: ${executesql.row.count}

update log_summary
SET blank_lines = ${text.line.count:minus(${text.line.nonempty.count})}
where ff_uuid= '${files_uuid}'

update log_summary
SET datatype_mismatch = ${count.invalid.lines}
where ff_uuid= '${files_uuid}'

